// Favorite.js
import React from "react";
import { FaHeart, FaRegHeart } from "react-icons/fa";

export default function Favorite({ selected = false, onToggle = f => f }) {
  return (
    <span onClick={onToggle} style={{ cursor: "pointer", fontSize: "1.5rem", color: selected ? "red" : "gray" }}>
      {selected ? <FaHeart /> : <FaRegHeart />}
    </span>
  );
}
